unordered_map< float, vector<float>> HashMap;

//input a[16] b[16] output out[16]
//get a
void T_multiply(float *a,float *b)
{
	float *out = new float[16];
    float a00 = a[0], a01 = a[1], a02 = a[2], a03 = a[3],
          a10 = a[4], a11 = a[5], a12 = a[6], a13 = a[7],
          a20 = a[8], a21 = a[9], a22 = a[10], a23 = a[11],
          a30 = a[12], a31 = a[13], a32 = a[14], a33 = a[15];

	    // Cache only the current line of the second matrix
    float b0  = b[0], b1 = b[1], b2 = b[2], b3 = b[3];
	      out[0] = b0*a00 + b1*a10 + b2*a20 + b3*a30;
	      out[1] = b0*a01 + b1*a11 + b2*a21 + b3*a31;
	      out[2] = b0*a02 + b1*a12 + b2*a22 + b3*a32;
	      out[3] = b0*a03 + b1*a13 + b2*a23 + b3*a33;

    b0 = b[4]; b1 = b[5]; b2 = b[6]; b3 = b[7];
    out[4] = b0*a00 + b1*a10 + b2*a20 + b3*a30;
    out[5] = b0*a01 + b1*a11 + b2*a21 + b3*a31;
    out[6] = b0*a02 + b1*a12 + b2*a22 + b3*a32;
    out[7] = b0*a03 + b1*a13 + b2*a23 + b3*a33;

    b0 = b[8]; b1 = b[9]; b2 = b[10]; b3 = b[11];
    out[8] = b0*a00 + b1*a10 + b2*a20 + b3*a30;
    out[9] = b0*a01 + b1*a11 + b2*a21 + b3*a31;
    out[10] = b0*a02 + b1*a12 + b2*a22 + b3*a32;
    out[11] = b0*a03 + b1*a13 + b2*a23 + b3*a33;

    b0 = b[12]; b1 = b[13]; b2 = b[14]; b3 = b[15];
    out[12] = b0*a00 + b1*a10 + b2*a20 + b3*a30;
    out[13] = b0*a01 + b1*a11 + b2*a21 + b3*a31;
    out[14] = b0*a02 + b1*a12 + b2*a22 + b3*a32;
    out[15] = b0*a03 + b1*a13 + b2*a23 + b3*a33;
    a = out;

}

void T_transformMat4(float *a, float *m){
    float *out = new float[4];
    // w = 1 !!!!!!!!!!!!!!!!!!!!!
    float x = a[0], y = a[1], z = a[2], w = 1;
        out[0] = m[0] * x + m[4] * y + m[8] * z + m[12] * w;
	    out[1] = m[1] * x + m[5] * y + m[9] * z + m[13] * w;
	    out[2] = m[2] * x + m[6] * y + m[10] * z + m[14] * w;
	    out[3] = m[3] * x + m[7] * y + m[11] * z + m[15] * w;
    a = out;

}


vector<float> my_multiple(float *a, float *b){
    float ha;
    float hb;
    vector<float> vb;
    vector<float> vc;

    //create hash value
    ha = (a[0]+a[1]+a[2]+a[3])*1000 + (a[4]+a[5]+a[6]+a[7])*100 + (a[8]+a[9]+a[10]+a[11])*10 + a[12]+a[13]+a[14]+a[15];
    //find in cache
    auto t = HashMap.find(ha);
    if (t != HashMap.end()){
        vb = t->second;
        hb = vb[0]*1000 + vb[1]*100 + vb[2]*10 + vb[3];
        auto tt = HashMap.find(hb);
        if (tt != HashMap.end()){
            return tt->second;
        }

    }
    hb = a[0]*1000 + a[1]*100 + a[2]*10 + a[3];
    vb.push_back(hb);
    HashMap[ha] = vb;
    float *out = new float[4];
    out = T_transformMat4(b , a);
    for (int i = 0; i < 4; i++){
        vc.push_back(out[i]);
    }
    HashMap[hb] = vc;

    return vc;
}

